import { useState, useEffect } from "react"
import { Link } from 'react-router-dom'

const TopRatedMovies = () => {

    const [topRatedMovies, setTopRatedmMovies] = useState([])

    useEffect(() => {
        fetch("https://api.themoviedb.org/3/movie/?api_key=41514cf9c5004dbe47144dbf1928e39c")
            .then(res => res.json())
            .then(data => setTopRatedmMovies(data.result))

    }, [])


    console.log(topRatedMovies)
}
